import React , {Component} from "react";
import Header from "./Header";

class Children_header extends Component{
    constructor(){
        super();
        Header.change_name = Header.change_name.bi
    }
    
    render(){
        return(
            <button onClick={Header.change_name}> Click</button>
        )
    }
}

export default Children_header;
